package com.cannontech.thirdparty.digi.model;

public class FileData {

    private String fdType;
    private String fdPath;
    private String fdName;
    private String fdData;
    
    public String getFdType() {
        return fdType;
    }

    public void setFdType(String fdType) {
        this.fdType = fdType;
    }

    public String getFdPath() {
        return fdPath;
    }
    
    public void setFdPath(String fdPath) {
        this.fdPath = fdPath;
    }
    
    public String getFdName() {
        return fdName;
    }
    
    public void setFdName(String fdName) {
        this.fdName = fdName;
    }
    
    public String getFdData() {
        return fdData;
    }
    
    public void setFdData(String fdData) {
        this.fdData = fdData;
    }
}
